import React from "react";
import logo from "../img/Pentagram.png"

const barStyles = {
    display:"inline",
    height: "7%", /* 100% Full-height */
    width: "100%", /* 0 width - change this with JavaScript */
    position: "fixed", /* Stay in place */
    zIndex: "1", /* Stay on top */
    top: "0", /* Stay at the top */
    backgroundColor: "hsl(169, 60%, 60%)", /* purple*/
}

const barItem = {
    display:"inherit",
    paddingLeft:"11%",
    paddingRight:"11%",
    textDecoration:"none",
    backgroundColor:"white"
}


function Navbar(){
    return(
        <div style = {barStyles}>
            <a href="home.html"><img src={logo} alt="logo" className = "logo"/></a>
            <a href="shop.html" style = {barItem}>Shop</a>
            <a href="contact.html" style = {barItem}>Contact</a>
            <a href="customize.html" style = {barItem}>Customize</a>
        </div>
    );
}

export default Navbar;
